import React,{Component} from 'react';
import Navbar from './Navbar';
import Footer from './Footer';
class Index extends Component{
    render(){
        return(
            <React.Fragment>
                <Navbar />
                <h1>Hello</h1>
                <Footer />
            </React.Fragment>
        );
    }
}

export default Index;
